            about_city:
                "Joypurhat is a district in the northern part of Bangladesh, under Rajshahi Division. It is called the store-house of food of Bangldesh, is famous for production of all the agricultural products. The economy of Joypurhat is mainly based on seasonal crops & fruits like Rice, Potato, Wheat, Onions, Mango, Jackfruits, Banana etc. A huge amount of sugarcane is also produced here as well; and it holds the country's largest sugar mill. There are also other industries like Rice mill & Poultry farm in this district. It exports about all kinds of agricultural products every day. Since Hili land port is very close to Joypurhat district, many people from this district do export-import business through this port and almost all the vehicles of this port runs through this district. This district is a very important business zone. Some places of interest in Joypurhat are: Bell Amla Bar Shivalaya (Shiva Temple), Pagla Dewan killing ground, Patharghata Church, Lakma Rajbari, Bhimer Punti, Duyani Ghat, Gopinathpur Temple, Hinda-Kasba Shahi Mosque, Nimai Pir's Shrine, Asranga Dighi, Nandail Dighi, Children's Park, Bastabpuri, etc.",
