            created_by: 0,
            updated_by: 0,
            top_city: 0,
            about_city:
                "Rajshahi is a major city on the north bank of the Padma River, near the Bangladesh-India border. This city has been historically important since the early 18th century, during the British Colonial rule. Ruled by Maharajas, Kings and Rulers, the city bears witness to notable industrial and agricultural development. Rajshahi silk is infamous countrywide for its fine craftsmanship and quality. Along with the silk industry, it has  jute mills, textile mills, sugar mill and mango based industries. Notable tourist attraction sites include: Varendra Research Museum, Shrine of Shah Makhdum Rupos, Kamruzzaman Central Park and Zoo, Banks of the Padma River, Shaheb Bazar, Ghoramara, Shahid Zia Park, and much more!",
