            top_city: 0,
            about_city:
                "Sreemangal is located in the north-eastern part of Bangladesh under Sylhet division. It is also known as the tea capital of Bangladesh with beautiful hilly areas covered with tea estates and pineapple gardens. Sreemangal is famous for its high quality tea, which is also exported worldwide. This place is also vastly famous for its natural beauty full of forests and wildlife; hence it covers as a prime Eco-Tourism Destination. Popular attractions in Sreemangal include: Lawachara National Park (tropical rain forest), Madhabkunda Waterfall (highest waterfall in Bangladesh), Madhabpur lake (the lake of lotus), Tea gardens, Monipuri & Khashia tribal villages, Baikkabeel (wetland of seasonal birds) and the infamous seven-layer tea found at Nilkantha Tea Cabin.",
