            about_city:
                "Sylhet, historically known as Jalalabad, is a major city that lies on the north-east part of Bangladesh. It is a relatively small city, however, with beautiful tourist destinations like, Jaflong, Lalakhal, Madhobpur Lake, HumHum waterfalls, Ratargul forest and other areas; it is one of the leading tourist destinations in the country. Sylhet also has one of the highest literacy rates in Bangladesh. Sylhet is sometimes called the second London as well.",
